import React, { Component } from "react";

class UserItem extends Component {
  state = {
    id: 10939256,
    login: "eder13",
    avatar_url: "https://avatars1.githubusercontent.com/u/10939256?v=4",
    html_url: "https://github.com/eder13",
  };

  render() {
    const { id, login, avatar_url, html_url } = this.state;

    return (
      <div className="card text-center">
        <img
          src={avatar_url}
          alt=""
          className="round-img"
          style={{ width: "60px" }}
        />
        <h3>{login}</h3>
        <a className="btn btn-dark btn-sm my-1" href={html_url}>
          Profile
        </a>
      </div>
    );
  }
}

export default UserItem;
